import React from 'react';
import styeld from 'styled-components';
import {Link} from 'react-router-dom';

const Button=styeld.img`
  width:24px;
  height:24px;
  float:right;
  margin-top:20px;
  margin-right: 100px;
`
function Main() {
  return (
      <Link to="/create"><Button src='images/newPost/newPost_normal.png'/></Link>
  );
}

export default Main;
